import React, {Component} from 'react';
import {Button} from 'reactstrap';
import './Home.css';

class Home extends Component{

    render() {
        return(
            <div>
                <p>Application</p>
                <Button className="button">Sign in!</Button>
                <Button className="button">Sign up!</Button>
            </div>
        );
    }
}

export default Home;
